import React from "react"

class HomePage extends React.Component {
    render() {
        return (
            <div>
                <h1 style = {{color:"red"}}>Welcome to TigerPhotos</h1>
                <div className="buttons">
                    <button className="fbutton">Browse Photographers</button>
                    <button className="fbutton">Create your Profile</button>
                </div>
            </div>
        )
    }
}

export default HomePage
